        # ==> High-level categories:
        # 1) generate any type of object, and keep either the largest of the smallest. Try to make sure it is unique in the grid for this max/min property.
        # 2) generate any type of object, and filter out either the largest of the smallest. Try to make sure it is unique in the grid for this max/min property.
        # 3) keep the object with the most or least inner objects -- generated objects must contain inner objects.
        # 4) filter out the object with the most or least inner objects -- generated objects must contain inner objects.
        # 5) simple shapes (non-rectangles) that are either symmetrical (h/v) or non-symmetrical (h/v)

        task_category = np.random.choice([1, 2, 3, 4])
        is_crop = False

        task_invalid = True
